import React  from 'react';
import Slider from 'react-slick';
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import ProductsSliderMenue from './ProductsSliderMenue';

function TestingCards() {
    var settings = {
        dot           : true,
        infinite      : true,
        speed         : 500,
        slidesToShow  : 1,
        slidesToScroll: 1,
        cssEase       : "linear"
    }
    return (
        <Slider {...settings}>
            <ProductsSliderMenue/>
        </Slider>
    )
}
export default TestingCards
